import React from 'react'
import './css/navbar.css'
import logo from './img/QuikieLogo.png'
function Navbar() {
    return (
        <>
            <nav className="nvbg">
                    <img src={logo}  alt=""></img>
            </nav>
        </>
    )
}


export default Navbar
